import { Link, Outlet } from "react-router-dom";



 function Header() {
    return (
        <div>
            <h1>Welcome</h1>
        <nav>
            <ul>
                <li>
                    <Link to="/">Home</Link>
                </li>
                
            </ul>
        </nav>
        <Outlet/>
        </div>
    );
}

export default Header;
